            .createPair(address(this), _uniswapV2Router.WETH());

        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;

        _approve(address(this), address(uniswapV2Router), type(uint256).max);

        marketingFeeOnBuy = 2;
        marketingFeeOnSell = 2;

        devFeeOnBuy = 1;
        devFeeOnSell = 1;

        nftPoolFeeOnBuy = 3;
        nftPoolFeeOnSell = 3;

        _totalFeesOnBuy = marketingFeeOnBuy + devFeeOnBuy + nftPoolFeeOnBuy;
        _totalFeesOnSell = marketingFeeOnSell +devFeeOnSell + nftPoolFeeOnSell;

        marketingWallet = 0x067D59Be689fdd14806df8A484CFbD390BB5206e;
        devWallet = 0x7405BC0328a1f0Eb540f2A34917085B723334F24;
        nftPoolWallet = 0xCFb8D98DC96E6E8a7eabe3b9b3009794C925e76E;
        busdAddress = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;


        walletToWalletTransferWithoutFee = true;


        _isExcludedFromFees[owner()] = true;
        _isExcludedFromFees[DEAD] = true;
        _isExcludedFromFees[address(this)] = true;
        _isExcludedFromFees[marketingWallet] = true;
        _isExcludedFromFees[devWallet] = true;
        _isExcludedFromFees[nftPoolWallet] = true;
        _isExcludedFromFees[newOwner] = true;


        _mint(newOwner, 10e9 * (10**18));
        swapTokensAtAmount = totalSupply() / 5000;
    }

    receive() external payable {}

    function claimStuckTokens(address token) external onlyOwner {
        require(token != address(this), "Owner cannot claim native tokens");
        if (token == address(0x0)) {
            payable(msg.sender).transfer(address(this).balance);
            return;
        }
        IERC20 ERC20token = IERC20(token);
        uint256 balance = ERC20token.balanceOf(address(this));
        ERC20token.transfer(msg.sender, balance);
    }

    //=======FeeManagement=======//
    function excludeFromFees(address account, bool excluded) external onlyOwner{
        require(_isExcludedFromFees[account] != excluded,"Account is already the value of 'excluded'");
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function updateBuyFees(uint256 _marketingFeeOnBuy,uint256 _devFeeOnBuy,uint256 _nftPoolFeeOnBuy) external onlyOwner {
        require(_marketingFeeOnBuy +_devFeeOnBuy +_nftPoolFeeOnBuy <=7,"Fees must be less than 8%");
        marketingFeeOnBuy = _marketingFeeOnBuy;
        devFeeOnBuy = _devFeeOnBuy;
        nftPoolFeeOnBuy = _nftPoolFeeOnBuy;
        _totalFeesOnBuy =marketingFeeOnBuy +devFeeOnBuy +nftPoolFeeOnBuy;
        emit UpdateBuyFees(marketingFeeOnBuy,devFeeOnBuy,nftPoolFeeOnBuy);
    }

    function updateSellFees(uint256 _marketingFeeOnSell,uint256 _devFeeOnSell,uint256 _nftPoolFeeOnSell) external onlyOwner {
        require(_marketingFeeOnSell +_devFeeOnSell +_nftPoolFeeOnSell <= 7,"Fees must be less than 8%");
        marketingFeeOnSell = _marketingFeeOnSell;
        devFeeOnSell = _devFeeOnSell;
        nftPoolFeeOnSell = _nftPoolFeeOnSell;
        _totalFeesOnSell =marketingFeeOnSell +devFeeOnSell +nftPoolFeeOnSell;
        emit UpdateSellFees(marketingFeeOnSell,devFeeOnSell,nftPoolFeeOnSell);
    }

    function enableWalletToWalletTransferWithoutFee(bool enable)external onlyOwner {
        require(walletToWalletTransferWithoutFee != enable,"Wallet to wallet transfer without fee is already set to that value");
        walletToWalletTransferWithoutFee = enable;
    }

    function changeMarketingWallet(address _marketingWallet)external onlyOwner{
        require(_marketingWallet != marketingWallet,"Marketing wallet is already that address");
        require(_marketingWallet != address(0), "Marketing wallet cannot be the zero address");
        marketingWallet = _marketingWallet;
        emit MarketingWalletChanged(marketingWallet);
    }

    function changeDevWallet(address _devWallet) external onlyOwner {
        require(_devWallet != devWallet, "Dev wallet is already that address");
        require(_devWallet != address(0), "Dev wallet cannot be the zero address");
        devWallet = _devWallet;
        emit DevWalletChanged(devWallet);
    }

    function changeNftPoolWallet(address _nftPoolWallet) external onlyOwner {
        require(nftPoolWallet != nftPoolWallet,"Nft Pool wallet is already that address");
        require(_nftPoolWallet != address(0), "Nft Pool wallet cannot be the zero address");
        nftPoolWallet = _nftPoolWallet;
        emit nftPoolWalletChanged(nftPoolWallet);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            canSwap &&
            !swapping &&
            to == uniswapV2Pair &&
            _totalFeesOnBuy + _totalFeesOnSell > 0
        ) {
            swapping = true;

            uint256 totalFee = _totalFeesOnBuy + _totalFeesOnSell;
            uint256 marketingShare = marketingFeeOnBuy + marketingFeeOnSell;
            uint256 devShare = devFeeOnBuy + devFeeOnSell;
            uint256 nftPoolShare = nftPoolFeeOnBuy + nftPoolFeeOnSell;

            uint256 initialBalance = address(this).balance;

            address[] memory path = new address[](2);
            path[0] = address(this);
            path[1] = uniswapV2Router.WETH();

            uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
                contractTokenBalance,
                0,
                path,
                address(this),
                block.timestamp
            );

            uint256 newBalance = address(this).balance - initialBalance;

            uint256 busdShare = marketingShare + devShare + nftPoolShare;
            

            if (busdShare > 0) {
                uint256 bnbToUsd = (newBalance * busdShare) / totalFee;
                path = new address[](2);
                path[0] = uniswapV2Router.WETH();
                path[1] = busdAddress;
                
                uint256 initialBusdBalance = IERC20(busdAddress).balanceOf(address(this));

                uniswapV2Router
                    .swapExactETHForTokensSupportingFeeOnTransferTokens{
                    value: bnbToUsd
                }(0, path, address(this), block.timestamp);

                uint256 currentBalance = IERC20(busdAddress).balanceOf(address(this));
                currentBalance -= initialBusdBalance;
                

                if (marketingShare > 0) {
                    uint256 marketingBusd = (currentBalance * marketingShare) / busdShare;
                    IERC20(busdAddress).transfer(
                        marketingWallet,
                        marketingBusd
                    );
                    emit SendMarketingWallet(marketingBusd);
                }

                if (nftPoolShare > 0) {
                    uint256 nftPoolBusd = (currentBalance * nftPoolShare) / busdShare;
                    IERC20(busdAddress).transfer(
                        nftPoolWallet,
                        nftPoolBusd);
                    emit SendNftPoolWallet(nftPoolBusd);
                }
                if (devShare > 0) {
                    uint256 devBusd = (currentBalance * devShare) / busdShare;
                    IERC20(busdAddress).transfer(
                        devWallet,
                        devBusd);
                    emit SendDevWallet(devBusd);
                }
            }

            swapping = false;
        }

        bool takeFee = !swapping;
        uint256 _totalFees;
        if (
            (_isExcludedFromFees[from] || _isExcludedFromFees[to]) || (walletToWalletTransferWithoutFee && from != uniswapV2Pair && to != uniswapV2Pair)) {
            takeFee = false;
        } else if (from == uniswapV2Pair) {
            _totalFees = _totalFeesOnBuy;
        } else {
            _totalFees = _totalFeesOnSell;
        } 

        if (takeFee && _totalFees > 0) {
            uint256 fees = (amount * _totalFees) / 100;
            amount = amount - fees;
            super._transfer(from, address(this), fees);
        }

        super._transfer(from, to, amount);
    }

    //=======Swap=======//
    function setSwapTokensAtAmount(uint256 newAmount) external onlyOwner {
        require(
            newAmount > totalSupply() / 100000,
            "SwapTokensAtAmount must be greater than 0.001% of total supply"
        );
        swapTokensAtAmount = newAmount;
    }

